import React from 'react'

    const Tickets = ({ tickets }) => {
      return (
        <div>
          <center><h1>Tickets List</h1></center>
          {tickets.map((ticket) => (
            <div class="card">
              <div class="card-body">
                <h5 class="card-title">{ticket.title}</h5>
                <h6 class="card-subtitle mb-2 text-muted">{ticket.email}</h6>
              </div>
            </div>
          ))}
        </div>
      )
    };

    export default Tickets
